import React from "react";

function SpeccedByOthersSelector({ speccedByOthers, setSpeccedByOthers }) {
  return (
    <div>
      <label>Specced by Others:</label>
      <div>
        <button
          onClick={() => setSpeccedByOthers(true)}
          className={speccedByOthers ? "selected" : ""}
        >
          Yes
        </button>
        <button
          onClick={() => setSpeccedByOthers(false)}
          className={!speccedByOthers ? "selected" : ""}
        >
          No
        </button>
      </div>
    </div>
  );
}

export default SpeccedByOthersSelector;
